import { Link } from "react-router-dom";
import React from "react";
import { useLocation } from "react-router-dom";
import { useState, useEffect } from "react";
import axios from "axios";
function Systemprocess() { 
    const [ProcessList, setProcessList] = useState([]);
    const location = useLocation();
    const title = new URLSearchParams(location.search).get("title");
    useEffect(() => {
        GetMeeting();
      }, []);
      const GetMeeting = () => {
        axios.get("http://localhost:3004/showprocess").then((response) => {
            setProcessList(response.data);
        });
      };
    return (
      <div className="choiceContainer">
       {ProcessList.map((val, key) => {
                return (
                    <div className="card-body text-left">
                    <p className="card-text">date: {val.date}</p>
                    <p className="card-text">topic_name: {val.topic_name}</p>
                    <p className="card-text">employee: {val.employee}</p>
                    <p className="card-text">duration: {val.duration}</p>
                    <p className="card-text">mean_worktype: {val.mean_worktype}</p>
                    </div>
                )
            }
            )}
        </div>
    );
  }
export default Systemprocess;
